import React, { Component } from "react";
// https://jsonplaceholder.typicode.com/posts
export default class Index extends Component {
  render() {
    return;
    <div>
      <h1>Index Page</h1>
      <Link href="/about">
        <a>About</a>
      </Link>
      <br></br>
      <Link href="/contact">
        <a>Contact</a>
      </Link>
    </div>;
  }
}

